import React from 'react';
import './IconContainer.css';

const IconContainer = ({ serviceType }) => {
  const renderIcon = () => {
    switch (serviceType) {
      case 'Custom Web Development':
        return (
          <svg
            xmlns="http://www.w3.org/2000/svg"
            viewBox="0 0 64 64"
            className="animated-icon"
          >
            <path fill="#ff6600" d="M4 8h56v48H4z" />
            <path fill="#fff" d="M12 16h40v32H12z" />
            <path fill="#0066cc" d="M20 24h24v16H20z" />
            <path fill="#ff6600" d="M28 32h8v8h-8z" />
          </svg>
        );
      case 'SaaS Solutions':
        return (
          <svg
            xmlns="http://www.w3.org/2000/svg"
            viewBox="0 0 64 64"
            className="animated-icon"
          >
            <path
              fill="#ff6600"
              d="M32 8a24 24 0 1 1-24 24 24.027 24.027 0 0 1 24-24m0-4a28 28 0 1 0 28 28A28 28 0 0 0 32 4z"
            />
            <path fill="#fff" d="M28 20h8v24h-8z" />
            <circle cx="32" cy="48" r="4" fill="#0066cc" />
          </svg>
        );
      case 'E-Commerce Development':
        return (
          <svg
            xmlns="http://www.w3.org/2000/svg"
            viewBox="0 0 64 64"
            className="animated-icon"
          >
            <path fill="#ff6600" d="M8 16h48v32H8z" />
            <path fill="#fff" d="M16 24h32v16H16z" />
            <circle cx="24" cy="40" r="4" fill="#0066cc" />
            <circle cx="40" cy="40" r="4" fill="#0066cc" />
          </svg>
        );
      default:
        return null;
    }
  };

  return <div className="icon-container">{renderIcon()}</div>;
};

export default IconContainer;
